import Herobanner from './component/Herobanner'

class App extends Component {
  render() {
  return (
    <BrowserRouter>
    <div className="App">
      <Navbar />
      <Herobanner />
      <Body />
    </div>
    </BrowserRouter>
  )
  }
}

export default App;
